import React from 'react'

export default function TextForm(props) {
  return (
    <div>     
        <div className="mb-3">
            <h1>{props.heading}</h1>
            <label for="myBox" className="form-label">Example textarea</label>
            <textarea className="form-control" id="myBox" rows="8"></textarea>
        </div>
    </div>
  )
}
